webpackJsonp([25820441450698],{1136:function(t,e){t.exports={data:{nodePost:{title:"Shop Talk Show 303: JAM Stack with Phil Hawksworth",link:"http://shoptalkshow.com/episodes/303-jam-stack-phil-hawksworth/",body:{value:"<p>A great listen that could serve as a solid introduction to the JAM Stack concept. Especially interesting was the focus on some common counter arguments to the JAM Stack (dynamic things like forms, comments and so on) and how those may be more achievable than one might originally assume. As I try to add a little more punch to the JAM Stack focused portion of <a href=\"https://events.drupal.org/nashville2018/sessions/hot-jamstack-building-music-discovery-app-drupal-and-react\">my DrupalCon talk</a> I see myself going back for another listen.</p>\r\n<p>With a <a href=\"https://www.drupal.org/psa-2018-001\">new critical Drupal security release</a> on the horizon, static site builds are looking better and better. I'm glad I won't have to won't have to worry about this site (Drupal isn't accessible to the public) while I scramble to apply the security release elsewhere.</p>"},relationships:{image:null},created:1521726778}},pathContext:{slug:"/link/shop-talk-show-303:-jam-stack-with-phil-hawksworth/"}}}});
